INSERT INTO `aboutus_segments` (`id`, `title`, `description`, `image`, `video`, `status`, `date`, `sort`) VALUES
(1, 'QUALITY', '<p>With robust sourcing techniques, and local partners in the regions we operate, HSP ensures continuous invention and improvement in all the products and services we offer. Our local associates in the region continuously monitor the manufacturing and packaging of all our products, leaving no stone unturned and making sure every piece is meticulously checked.</p>', 'about2-1.jpg', '', 1, '2015-07-22 13:52:37', 3),
(3, 'THE PRODUCTS', '<p>HomeStuff Plus import a wide range of furniture including sofas, bar stools, coffee tables, bedroom furniture, sideboards, arts and more. As the company grows, we aim to expand our range of products and hold increasing levels of stock. We continue to innovate and enhance the trend both seasonally and in between.</p>', 'about1-2.jpg', '', 1, '2015-07-22 13:53:36', 2),
(5, 'SERVICE', '<p>We are dedicated to delivering the best experience to our customers and value the long term relationships we have with existing ones. HSP prides itself in delivering an efficient, punctual and reliable service and that&rsquo;s where we always aim to stand out.</p>', 'about3-1.jpg', '', 1, '2015-07-22 13:52:56', 4);
INSERT INTO `about_us` (`abt_id`, `subcat_title`, `description`, `date`, `slug`, `route_id`, `meta_title`, `meta_desc`, `keywords`, `status`) VALUES
(1, 'About Us', '<p>HomeStuff Plus is predominantly an importer and wholesaler of quality affordable homeware and furniture. &nbsp;The company has been established for over 3 years and has since grown considerably in reputation and excellence. &nbsp;Located conveniently in the heart of England, we are well placed to effortlessly connect with all our customers and clients across the country.&nbsp;</p><p>We have now decided to venture into the mainstream trade to further strengthen ourselves as a leader in the market. &nbsp;Our furniture is sourced from China, Indonesia and India, with a view to expanding sources across the whole of the Far East over the next few years.</p><p>Amassing over 30 years of experience in the furniture market, our team realises that quality, price and customer service is an integral part of our growth. &nbsp;We pride ourselves in delivering products of the highest quality at competitive price points. &nbsp;At HSP, we aim to cover every sector of the market; from low to mid-range to high level.</p><p>Over the next few years, HSP targets exponential growth as it continues to enhance local relations and more importantly increases its base of satisfied customers. &nbsp;We have the ingredients and attributes to be a key competitor in the industry.</p>', '2015-07-20', 'about-us', 1, 'About Us', 'About Us', 'About Us', 1);
