INSERT INTO `faq_questions` (`id`, `slug`, `route_id`, `faq_id`, `question`, `answer`, `sort_order`, `status`, `cat_id`) VALUES
(38, 'where-do-you-ship-to111', '', 1, ' Where do you ship to?     ', '<p class=\"MsoNormal\">Sadly we&rsquo;re UK and Northern Ireland only at the moment, but we will have distribution across Europe, and globally in the very near future. Not only will we sell to these territories but we will ship from within them too.</p>', 10, 1, 17),
(39, '', '', 1, ' What are your shipping rates?', '<p class=\"MsoNormal\">We have 3 tiers of shipping options at present:</p>\n<p class=\"MsoNormal\">2<sup>nd</sup> Class signed for (&pound;2.75)</p>\n<p class=\"MsoNormal\">1<sup>st</sup> Class signed for (&pound;3.75)</p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\">Guaranteed next day (&pound;6.99)</p>', 11, 1, 17),
(40, '', '', 1, ' How soon will you despatch after I\'ve ordered?', '<p class=\"MsoNormal\">If you order before 3pm, we will send the same day. After 3pm will be despatched in the next day&rsquo;s post. Orders placed after 3pm Friday, or over the weekend, will be despatched on the following Monday.</p>', 3, 1, 17),
(41, '', '', 1, ' Are your liquids and concentrates free of \'nasties\'?` ', '<p class=\"MsoNormal\">In short, yes. We&rsquo;ve gone &lsquo;above and beyond&rsquo; in our due diligence with our raw ingredients, requesting MSDS and GCMS sheets for every one of the flavours we use to make our delicious e-liquids. None of them contain Acetoin Isopropyl, Diacetyl, lipid containing oils or anything else that is known to be a potential harm. And we&rsquo;ll tell you &ndash; producing tasty juices that don&rsquo;t contain those things is hard work.</p>\n<p>We are at present having all our juices GCMS tested too&hellip; but even in that, we&rsquo;re going &lsquo;above and beyond&rsquo;. We&rsquo;re testing the juice as it comes off the production line. We&rsquo;re testing the juice once it&rsquo;s been steeped. We&rsquo;re testing the juice when it&rsquo;s been exposed to extreme heats (60 degrees celcius) and extreme cold (-10 degrees celcius). That way you&rsquo;ll know &ndash; whatever conditions you keep your juices, you&rsquo;ll know what that does for your liquid, and your health.</p>', 12, 1, 23),
(42, '', '', 1, ' How long should I steep my eliquid? ', '<p>Where possible, we don\'t sell our liquids until they\'ve had the minimum amount of time we believe necessary for steeping. This isn\'t always possible, however.</p>\n<p>In general, we recommend allowing 2 weeks from the liquid\'s Date of Birth, which you will find on the label. Some liquids benefit from longer.</p>\n<ul>\n<li>Nana Chews, Smoak, Chestex and Not Original need around 3 weeks</li>\n<li>Pastel Da Nutter really needs around 4 weeks to get into its best</li>\n<li>Che Fernandez really comes into its own after around 6 weeks.</li>\n</ul>\n<p>Of course, you can start enjoying your liquid whenever you\'re ready, but we recommend leaving for at least these times to get the absolute best out of our liquids, and taste them the way we intended them.</p>', 7, 1, 23),
(43, '', '', 1, ' How long should I steep liquids made from your concentrates?', '<p>The same rules apply to liquids you make from our concentrates as they do to our bottled liquids. In general, most liquids need around 2 weeks to get the best out of them. There are a number of liquids that need longer. Please see the question on how long to steep our bottled liquids for additional information.</p>', 6, 1, 23),
(44, 'how-much-concentrate-do-i-need-to-use-to-make-the-same-as-your-b', '', 1, ' How much concentrate do I need to use to make the same as your bottled liquids? ', '<p>This varies hugely from flavour to flavour - our recommended level for each can be found on the individual product pages. Some require just 10% while others need up to 25% to make as tasty as our bottled liquids. However, the level of flavouring that works for you may vary.</p>', 4, 1, 23),
(45, '', '', 1, ' Why can\'t I buy premium flavours as concentrates?', '<p>Our premium liquids invariably have very high percentages of flavouring. Not only that, but we\'re keen to protect our recipes and stop others selling our premium flavours under their own name.</p>', 8, 1, 23),
(46, 'what-nicotine-level-should-i-start-at', '', 1, ' What nicotine level should I start at?  ', '<p>This really depends on two factors:&nbsp;</p>\n<ul>\n<li>How much did you used to smoke?</li>\n<li>What equipment are you going to use?</li>\n</ul>\n<p>If you smoke around 20 a day and intend to use a starter kit, we recommend starting at 18-24mg.&nbsp;</p>\n<p>If you smoke 10 per day and are using a starter kit, try 12-18mg.</p>\n<p>If you smoke less than 10 per day and are using a starter kit, try 6-12mg.</p>\n<p>If you\'re using standard beginner setups such as the ego or eSmart starter kits, you will naturally require a higher nicotine strength than if you\'re using sub ohm tanks and higher power. Some e-cigarettes and personaly vapourisers run at high power. These devices generally allow users to consumer a greater volume of liquid in a shorter space of time than \'standard\' equipment. If you\'re using this type of setup, you will naturally require a low nicotine liquid.</p>', 9, 1, 24),
(58, 'vsdaf-fsdagasdg-vdsgdsag-dsgsa', '355', 1, ' sadgsagsda               ', '<p>gsdagsadg</p>', 1, 1, 17),
(59, 'gsag-dsgbgsdg', '359', 1, ' gsdag  ', '<p>gsadgasgsa</p>', 13, 1, 17),
(60, 'dsafasdf', '403', 1, ' dsafasdf ', '<p>fsadfasf</p>', 14, 1, 17),
(61, 'test-on-testing', '410', 1, ' Test on testing ', '<p>&nbsp;Test on testing&nbsp;&nbsp;Test on testing</p>', 2, 0, 25),
