(1, 'How We Use Cookies', '<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: 12.6pt; mso-outline-level: 2; background: white;\"><strong><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">How We Use Cookies</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">Like many websites we use cookies to store and then retrieve small bits of information on your computer when you visit. This information is used to make the site work as you expect it to. It is not personally identifiable to you, but it can be used to give you a more personalised web experience.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">Some of the information stored is put there by other companies whose software we have added to the site, and this can also impact your experience of other websites you may visit after leaving ours.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">If you continue to use this site without taking action to prevent the storage of this information, you are effectively agreeing to this use.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">If you want to learn more about the general uses of cookies, including how to stop them being stored by your computer, please visit&nbsp;<a href=\"http://cookiepedia.co.uk/all-about-cookies\" target=\"_blank\"><span style=\"mso-field-code: \' HYPERLINK;\"><strong><span style=\"text-decoration: underline;\"><span style=\"color: #33378e;\">Cookiepedia - all about cookies</span></span></strong></span></a>.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">Below is a list of the different types of cookies used on this site, and an explanation of what they are used for. If you would like any more information, please get in touch.</span></p>\n<ul>\n<li><strong style=\"color: #282727; line-height: 12.6pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-fareast-language: EN-GB;\">Strictly Necessary Cookies</span></strong></li>\n</ul>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">These cookies are necessary for the website to function. They are usually only set in response to actions made by you which amount to a request for services, such as logging in or filling in forms.</span></p>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">You can set your browser to block or alert you about these cookies, but some parts of the site will not then work. These cookies do not store any personally identifiable information.</span></p>\n<ul>\n<li><strong style=\"color: #282727; line-height: 12.6pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-fareast-language: EN-GB;\">Performance Cookies</span></strong></li>\n</ul>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">These cookies allow us to count visits and traffic sources so we can measure and improve the performance of our site. They help us to know which pages are the most and least popular and see how visitors move around the site.</span></p>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">All information these cookies collect is aggregated and therefore anonymous. If you do not allow these cookies we will not know when you have visited our site, and will not be able to monitor its performance.</span></p>\n<ul>\n<li><strong style=\"color: #282727; line-height: 12.6pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-fareast-language: EN-GB;\">Functionality Cookies</span></strong></li>\n</ul>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">These cookies enable the website to provide enhanced functionality and personalisation. They may be set by us or by third party providers whose services we have added to our pages.</span></p>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">If you do not allow these cookies then some or all of these services may not function properly.</span></p>\n<ul>\n<li><strong style=\"color: #282727; line-height: 12.6pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-fareast-language: EN-GB;\">Targeting Cookies</span></strong></li>\n</ul>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">These cookies may be set through our site by our advertising partners. They may be used by those companies to build a profile of your interests and show you relevant adverts on other sites.</span></p>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">They do not store any personally identifiable information, but are based on uniquely identifying your browser and internet device. If you do not allow these cookies, you will experience less targeted advertising.</span></p>\n<ul>\n<li><strong style=\"color: #282727; line-height: 12.6pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-fareast-language: EN-GB;\">Other Cookies</span></strong></li>\n</ul>\n<p class=\"MsoNormal\" style=\"line-height: 14.7pt; background: white; margin: 0cm 0cm 4.5pt 36.0pt;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">The following cookies are also set by our site, however their purpose has not yet been identified. We are conducting research into these cookies and will update this page as soon as possible.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">If you wish to delete these cookies please visit&nbsp;</span><a href=\"http://www.aboutcookies.org\" target=\"_blank\"><span lang=\"EN-GB\"><span style=\"mso-field-code: \' HYPERLINK;\"><strong><span style=\"text-decoration: underline;\"><span style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #33378e; mso-fareast-language: EN-GB;\">www.aboutcookies.org</span></span></strong></span></span></a><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">&nbsp;for instructions for most browsers.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 4.5pt; line-height: 14.7pt; background: white;\"><span lang=\"EN-GB\" style=\"font-size: 10.5pt; font-family: Arial; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #282727; mso-fareast-language: EN-GB;\">Please also see our <strong>Privacy Policy</strong>.</span></p>', '2014-11-19', 'how-we-use-cookies', '4', 'How We Use Cookies', 'How We Use Cookies', 'How We Use Cookies', 0);
