INSERT INTO `our_guarantee` (`id`, `subcat_title`, `description`, `date`, `slug`, `route_id`, `meta_title`, `meta_desc`, `keywords`, `status`) VALUES
(1, 'Delivery Information  ', '<p><strong>Delivery information</strong></p>\n<p>We are currently offering free UK delivery on all orders over &pound;40<br />For orders under &pound;40 we charge a flat rate of &pound;1.95<br />For EU Shipping we charge a flat rate of &pound;12.<br />We use Royal Mail recorded delivery for all of our UK deliveries and most of our orders are delivered within 1-3 days.<br />Order cut-off for all delivery services is 3pm (UK time). Orders placed after 3pm will be treated, for the purposes of delivery, as having been placed the next working day.<br />We try our best to accommodate and be as flexible as possible, please email us if you have any specific requirements at sales@myvapery.com</p>\n<p>Working days are defined as Monday &ndash; Friday (excluding bank and public holidays) &ndash; therefore any orders placed after 3pm on Friday will not be processed until Monday.</p>\n<p>Delivery will be sent out via Royal Mail signed for.</p>\n<p>Upgrade to special delivery for a flat fee of &pound;6.95 for guaranteed next day delivery. &nbsp;Special Delivery will be shipped via UPS)</p>\n<p>Royal Mail Signed For and Royal Mail Special Delivery require a signature to confirm receipt. If a signature cannot be obtained, the carrier may ask a neighbour to sign for the delivery. Deliveries that require a signature will not be left if a signature cannot be obtained. If the carrier leaves the delivery with a neighbour or at your local post office, they will leave a card for you telling you where it is. You may, when placing your order online, specify a different delivery address than your payment address if that is more convenient for you.</p>\n<p>All delivery timescales are approximate and subject to availability. The precise timing of a delivery cannot be specified.</p>\n<p>International Shipping: Please note that when ordering from My Vapery you\'re responsible for all customs, duties/taxes and assuring that the product can be lawfully imported to the destination country. &nbsp;All EU items will be sent by 1st class, tracked &amp; signed post.</p>\n<p><strong>Insurance &ndash; PLEASE READ</strong></p>\n<p>All our free flat rate and Royal Mail Signed for services are insured up to the value of &pound;50. We recommend choosing the Royal Mail Special Delivery option for all orders over &pound;50 as this covers goods up to &pound;500 and is guaranteed next day delivery.<br />We can only refund / replace goods up to the value of &pound;50 if the Royal Mail Signed for option is chosen.</p>\n<p>If your order has not arrived within 3 working days please contact us with your order number immediately.</p>\n<p>If you require any clarification on the above please feel free to contact us by emailing sales@myvapery.com.</p>', '2014-11-19', 'delivery-information', '16', 'Delivery Information', 'Delivery Information\n\n', 'Delivery Information', 0);
