(6, 'Living product test 1', 'living-product-test-1', 703, 0, 0, '', '', '<p><em><strong>A <a title=\"Terraced house\" href=\"https://en.wikipedia.org/wiki/Terraced_house\">terraced house</a><sup id=\"cite_ref-6\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Home#cite_note-6\">[a]</a></sup> is a style of <a title=\"Medium-density housing\" href=\"https://en.wikipedia.org/wiki/Medium-density_housing\">medium-density housing</a> where a row of identical or mirror-image houses share side walls, while <a title=\"Semi-detached\" href=\"https://en.wikipedia.org/wiki/Semi-detached\">semi-detached</a> housing consists of pairs of houses built side-by-side or (less commonly) back-to-back,<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Home#cite_note-7\">[6]</a></sup> sharing a <a title=\"Party wall\" href=\"https://en.wikipedia.org/wiki/Party_wall\">party wall</a> and with mirrored layouts.</strong></em></p>\n<p><em><strong>An <a title=\"Apartment\" href=\"https://en.wikipedia.org/wiki/Apartment\">apartment</a> (in <a title=\"Comparison of American and British English\" href=\"https://en.wikipedia.org/wiki/Comparison_of_American_and_British_English#Levels_of_buildings\">American English</a>) or a flat (in <a title=\"British English\" href=\"https://en.wikipedia.org/wiki/British_English\">British English</a>) is a self-contained housing unit (a type of residential <a title=\"Real estate\" href=\"https://en.wikipedia.org/wiki/Real_estate\">real estate</a>) that occupies only part of a <a title=\"Building\" href=\"https://en.wikipedia.org/wiki/Building\">building</a>. Such a building may be called an apartment building, apartment house (in American English), block of flats, <a title=\"Tower block\" href=\"https://en.wikipedia.org/wiki/Tower_block\">tower block</a>, high-rise or, occasionally mansion block (in British English), especially if it consists of many apartments for <a title=\"Renting\" href=\"https://en.wikipedia.org/wiki/Renting\">rent</a>. In Scotland it is called a block of flats or if its a traditional <span style=\"text-decoration: underline;\">sandstone</span> building a tenement, which has a pejorative connotation elsewhere. Apartments may be owned by an owner/occupier by leasehold tenure or rented by tenants <span style=\"text-decoration: line-through;\">(two types of <a title=\"Housing tenure\" href=\"https://en.wikipedia.org/wiki/Housing_tenure\">housing tenure</a>)</span>.</strong></em></p>\n<table style=\"height: 35px;\" width=\"226\">\n<tbody>\n<tr>\n<td>1</td>\n<td>1</td>\n<td>1</td>\n</tr>\n<tr>\n<td>2</td>\n<td>2</td>\n<td>2</td>\n</tr>\n</tbody>\n</table>', '0', 'https://www.youtube.com/embed/8wwA4tywdaw', '', 400.00, 300.00, 69, 14, 0, 0.00, 0, 1, 'LPT 1', '', '', 'false', 0, 0, 0, 0, 0, '', '0', '0', 1, 40, 0, 1, 0, '2015-07-22 10:56:10', '2015-09-14 15:52:26', '2017-10-03 12:33:48', '0000-00-00 00:00:00'),
