INSERT INTO `template` (`temp_id`, `template_name`, `from_email`, `bcc`, `assigned_to`, `sign_id`, `subject`, `html_editor`, `url`, `full_url`, `status`) VALUES
(3, 'Change Admin Password', 'no-reply@homestuffplus.com', '', 12, 0, 'Forgot Password', '<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\"> Dear,&nbsp;{{var admin.email}}<br /></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">&nbsp;You have requested for new password,Your login details are below,</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Username:{{var admin.email}}<br /></span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Password:{{var admin.password}}</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">&nbsp;</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Login to your account</span><span style=\"font-size: 12pt;\"><a style=\"font-size: 12pt;\">&nbsp;{{var admin.url}}</a></span></p><p class=\"MsoNoSpacing\">&nbsp;</p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Full your is:{{var admin.fullurl}}</span></p>', '<p class=\'MsoNoSpacing\'><span style=\'font-size: 12pt;\'><a href=\'\".base_url().\"admin/login/\'>Click here </a></span></p>', 'http://localhost/ekart/admin/login/', 1),
(4, 'Contact Us Acknowledgement', 'no-reply@homestuffplus.com', '', 4, 0, 'Thank You for Contacting Home Stuff Plus', '<p style=\"margin: 0px; font-size: 12px; font-family: Calibri; min-height: 14px;\"><span style=\"font-size: 12pt;\">Dear {{var customers.name}},</span></p><p style=\"margin: 0px; font-family: Calibri; min-height: 13px;\"><span style=\"font-size: 12pt;\">&nbsp;</span></p><p style=\"margin: 0px; font-family: Calibri; min-height: 13px;\"><span style=\"font-size: 12pt;\">Thank you for your request. A member of our customer service will shortly get back to you to answer your query.</span></p><p style=\"margin: 0px; font-family: Calibri; min-height: 13px;\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>', '', '', 1),
(5, 'Order Received', 'no-reply@homestuffplus.com', '', 5, 0, 'Thank You for your Order with Home Stuff Plus', '<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt; color: #000000;\">Dear {{var customers.name}},</span></p><p class=\"MsoNoSpacing\"><span style=\"color: #000000;\"><span style=\"font-size: 12pt;\">We are delighted to inform you that your order on the Home Stuff Plus&nbsp;website&nbsp;has been received successfully and&nbsp;we thank&nbsp;you for that.&nbsp;</span><span style=\"font-size: 12pt; font-family: \'Open Sans\', sans-serif; line-height: 20px;\">For your reference here are the details of your order:</span></span></p><p class=\"MsoNoSpacing\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #797979; font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\"><span style=\"box-sizing: border-box; font-size: 12pt; color: #000000;\">Order number:&nbsp;{{var orders.orderid}}</span></p><p class=\"MsoNoSpacing\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #797979; font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\"><span style=\"box-sizing: border-box; font-size: 12pt; color: #000000;\">Order Date:&nbsp;{{var orders.ordered_date}}</span></p><p class=\"MsoNoSpacing\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #797979; font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\"><span style=\"color: #000000;\">&nbsp;</span></p><p class=\"MsoNoSpacing\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #797979; font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\"><span style=\"box-sizing: border-box; font-size: 12pt; color: #000000;\">Delivery Address:</span></p><p class=\"MsoNoSpacing\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #797979; font-family: \'Open Sans\', sans-serif; font-size: 14px; line-height: 20px;\"><span style=\"box-sizing: border-box; font-size: 12pt; color: #000000;\">{{var