(6, 'Order Confirmed', 'no-reply@homestuffplus.com', '', 6, 0, 'Your Order is Confirmed', '<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Dear {{var customers.name}},</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">This is a confirmation email of your order placed on the Home Stuff Plus&nbsp;website&nbsp;which is currently under process.&nbsp;For your&nbsp;reference here are the details of your order:</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Order number:&nbsp;{{var orders.orderid}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Order Date:&nbsp;{{var orders.ordered_date}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">{{var orders.product_list}}</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Delivery Address:</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">{{var orders.shipping_addr}}</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Once your order has been shipped, you will receive the tracking number to track your package.</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Check your status of your Order&nbsp;</span></p>', '', '', 1),
