(8, 'Order Shipped', 'no-reply@homestuffplus.com', '', 8, 0, 'Your Order is Shipped', '<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Dear {{var customers.name}},</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">We are pleased to inform you that your order placed on Home Stuff Plus&nbsp;website&nbsp;has been shipped. If you would&nbsp;like to&nbsp;track your package, please follow the link below:</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Order No.:&nbsp;{{var orders.orderid}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Order Date:&nbsp;{{var orders.ordered_date}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Expected Delivery Date: {{var orders.delivery_date}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Courier No.: {{var orders.courier_no}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Courier: {{var orders.courier_name}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Track Shipping here: {{var orders.courier_url}}<br /></span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">{{var orders.product_list}}</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Delivery Address:</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">{{var orders.shipping_addr}}&nbsp;</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">With our international courier service, you should receive your goods within 7-14 working days subject to service period of Customs at the destination country.</span></p>', '', '', 1),
(9, 'Order Delivered', 'no-reply@homestuffplus.com', '', 9, 0, 'Your Order is Successfully Delivered', '<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Dear {{var customers.name}},</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">We are pleased to inform you that according to our tracking, your order {{var orders.orderid}}&nbsp;has been delivered to the following address:</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">{{var orders.shipping_addr}}</span></p>\n<p class=\"MsoNoSpacing\">&nbsp;</p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">{{var orders.product_list}}</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">&nbsp;</span></p>\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">We hope the products will provide you entire satisfaction. We would greatly appreciate your feedback that you can post on our website.</span></p>', '', '', 1),
(13, 'Order Cancelled', 'no-reply@homestuffplus.com', '', 10, 2, 'Your order has been Cancelled', '<p>Refund Amount: {{var orders.refund_amount}}</p>\n<p>Comments: {{var orders.comments}}</p>\n<p>&nbsp;</p>', '', '', 1),
(25, 'Forgot passsword link', 'no-reply@homestuffplus.com', '', 12, 4, 'Forgot password link ', '<p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Dear,{{var admin.email}}<br /></span></p><p class=\"MsoNoSpacing\">&nbsp;</p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Your change password link is&nbsp;{{var admin.url}},</span></p><p class=\"MsoNoSpacing\"><span style=\"font-size: 12pt;\">Full Url:{{var admin.fullurl}}</span></p>', '<p><a href=http://192.168.1.242/ekart/admin/login/f/ce08af355fec560e607f08f9a2217f0f9ed39983>Click here</a></p>', 'http://192.168.1.242/ekart/admin/login/f/ce08af355fec560e607f08f9a2217f0f9ed39983', 1),
(31, 'New Customer welcome email', 'no-reply@homestuffplus.com', '', 1, 0, 'Welcome to Home Stuff Plus', '<p>Dear {{var customers.name}},</p>\n<p>&nbsp;</p>\n<p>Thank you for your interest. You are now registered on Home Stuff Plus website.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Your login details are as follow:</p>\n<p>USERNAME:&nbsp;{{var customers.email}}</p>\n<p>PASSWORD:&nbsp;{{var customers.password}}</p>', '', '', 1),
(32, 'Forgot Password', 'no-reply@homestuffplus.com', '', 2, 0, 'Your new password confirmation', '<p><span>Dear {{var customers.name}},</span></p><p><span>Please find below your login details as requested:</span></p><p><span>USERNAME:&nbsp;{{var customers.email}}</span></p><p><span>PASSWORD:&nbsp;{{var customers.password}}</span></p><p><span>&nbsp;</span></p><p><span>Login to your account <a href=\"http://techactive.tk/hsp/account/login\">Click Here</a></span></p>', '', '', 1),
(33, 'Low Stock Notification', 'no-reply@homestuffplus.com', '', 13, 0, 'Low Stock Notification From Home Stuff Plus', '<p>Dear Admin,</p>\n<p>These Products&nbsp; are&nbsp; low In stock .</p>\n<p>{{var Product.name}}</p>\n<p>Thank You</p>', '', '', 1),
(34, 'Newsletter Subscription', 'no-reply@homestuffplus.com', '', 3, 0, 'Thank you for subscribing with us', '<p>Thank you for your subscription..</p>\n<p>We will keep you updated with our latest news.</p>', '', '', 1);
