(1, 'Terms and Conditions', '<p>Please read the following terms and conditions very carefully as your use of service is subject to your acceptance of and compliance with the following terms and conditions (\"Terms\").</p>\n<p>By subscribing to or using any of our services you agree that you have read, understood and are bound by the Terms, regardless of how you subscribe to or use the services. If you do not want to be bound by the Terms, you must not subscribe to or use our services. These Terms and various other policies are binding as per the provisions of the Information Technology (Intermediaries guidelines) Rules, 2011 formulated under the Information Technology Act of 2000.</p>\n<p>In these Terms, references to \"you\", \"User\" shall mean the end user accessing the Website, its contents and using the Services offered through the Website, \"Service Providers\" mean independent third party service providers, and \"we\", \"us\" and \"our\" shall mean Vector E-commerce Private Limited and its affiliates.</p>\n<h3>1) Introduction:</h3>\n<p>a) <a href=\"http://techactive.tk/homestuffplus/www.website.com\">www.website.com</a>(\"Website\") is an Internet based content and e-commerce portal licensed by Vector E-commerce Private Limited, a company incorporated under the laws of India.</p>\n<p>b) Use of the Website is offered to you conditioned on acceptance without modification of all the terms, conditions and notices contained in these Terms, as may be posted on the Website from time to time. homestuffplus.com at its sole discretion reserves the right not to accept a User from registering on the Website without assigning any reason thereof.</p>\n<h3>2. Use Account, Password and Security:</h3>\n<p>You will receive a password and account designation upon completing the Website\'s registration process. You are responsible for maintaining the confidentiality of the password and account, and are fully responsible for all activities that occur under your password or account. You agree to (a) immediately notify homestuffplus.com of any unauthorized use of your password or account or any other breach of security, and (b) ensure that you exit from your account at the end of each session. homestuffplus.com cannot and will not be liable for any loss or damage arising from your failure to comply with this Section 2.</p>\n<h3>3. Service Offered:</h3>\n<p>homestuffplus.com provides a number of Internet-based services through the Web Site (all such services, collectively, the \"Service\"). One such service enables users to purchase original merchandise such as clothing, footwear and accessories from various fashion and lifestyle brands (collectively, \"Products\"). The Products can be purchased through the Website through various methods of payments offered. The sale/purchase of Products shall be additionally governed by specific policies of sale, like cancellation policy, return policy, etc. (which are found on the following URL http://www.homestuffplus.co.uk/faqs), and all of which are incorporated here by reference. In addition, these terms and policies may be further supplemented by Product specific conditions, which may be displayed on the webpage of that Product.</p>\n<h3>4. Privacy Policy:</h3>\n<p>The User hereby consents, expresses and agrees that he has read and fully understands the Privacy Policy of homestuffplus.com. The user further consents that the terms and contents of such Privacy Policy are acceptable to him.</p>\n<h3>5. Limited User:</h3>\n<p>The User agrees and undertakes not to reverse engineer, modify, copy, distribute, transmit, display, perform, reproduce, publish, license, create derivative works from, transfer, or sell any information or software obtained from the Website. Limited reproduction and copying of the content of the Website is permitted provided that homestuffplus\'s name is stated as the source and prior written permission of homestuffplus.com is sought. For the removal of doubt, it is clarified that unlimited or wholesale reproduction, copying of the content for commercial or non-commercial purposes and unwarranted modification of data and information within the content of the Website is not permitted.</p>\n<h3>6. User Conduct and Rules:</h3>\n<p>You agree and undertake to use the Website and the Service only to post and upload messages and material that are proper. By way of example, and not as a limitation, you agree and undertake that when using a Service, you will not:</p>\n<p>a) defame, abuse, harass, stalk, threaten or otherwise violate the legal rights of others;</p>\n<p>(b) publish, post, upload, distribute or disseminate any inappropriate, profane, defamatory, infringing, obscene, indecent or unlawful topic, name, material or information;</p>\n<p>(c) upload files that contain software or other material protected by intellectual property laws unless you own or control the rights thereto or have received all necessary consents; you own or control the rights thereto or have received all necessary consents;</p>\n<p>(d) upload or distribute files that contain viruses, corrupted files, or any other similar software or programs that may damage the operation of the Website or another\'s computer;</p>\n<p>(e) conduct or forward surveys, contests, pyramid schemes or chain letters;</p>\n<p>(f) download any file posted by another user of a Service that you know, or reasonably should know, cannot be legally distributed in such manner;</p>\n<p>(g) falsify or delete any author attributions, legal or other proper notices or proprietary designations or labels of the origin or source of software or other material contained in a file that is uploaded;</p>\n<p>(h) violate any code of conduct or other guidelines, which may be applicable for or to any particular Service;</p>\n<p>(i) violate any applicable laws or regulations for the time being in force in or outside India; and</p>\n<p>(j) violate, abuse, unethically manipulate or exploit, any of the terms and conditions of this Agreement or any other terms and conditions for the use of the Website contained</p>', 1, 'terms-and-conditions', 15, 'Terms and Conditions', 'By using our website to order products or services or to contact us for any reason, you are agreeing to these Terms and Conditions and our Privacy Statement which can be read here.', 'Terms and Conditions');
